import React from 'react';
import HeroSection from '../components/HeroSection';  // Componente com fundo estático
import './Home.css';  // Se você quiser customizar o estilo da Home

const Home = () => {
  return (
    <div>
      <HeroSection />  {/* Componente com fundo estático e fundo em movimento */}
      <div className="tournaments">
        <h3>Próximos Torneios</h3>
        <p>Aqui listamos os próximos torneios de Beach Tennis organizados pela Nareia.</p>
        {/* Aqui você pode adicionar mais conteúdo de torneios */}
      </div>
    </div>
  );
};

export default Home;
